import React, { useEffect, useState } from 'react'
import Drawn from './Drawn'

export default function Dragonfly() {
  const [drawn, setDrawn] = useState({})

  useEffect(() => {
    async function fetchData() {
      const res = await fetch("http://localhost:3000/spreads/dragonfly")
      res.json().then(res => setDrawn(res))
    }

    fetchData()
  })

  return (
    <div>
      {drawn.map(card => <Drawn key={card} card={card} />)}
    </div>
  )
}
